import React from 'react'

export default function List()
{
    const animals=["dog","cat","lion","tiger"]
    const result=animals.map((ani,index)=><li key={index}>{index} {ani}</li>)
    return(
        <div>
            <ul>
                {result}
            </ul>
        </div>
    )
}
